import React from 'react';
import {
    View,
    Text
} from 'react-native';

const MainLayout = () => {
    return (
        <View
            style={{
                flex: 1,
                alignItems: 'center',
                backgroundColor: COLORS.primary,
                justifyContent: 'center'
            }}
        >
            <Text>Main Layout</Text>
        </View>
    )
}

export default MainLayout;
